INSERT INTO `Movies` (`movieID`, `typeID`, `Name`, `director`, `performer`, `time`, `language`, `premiere`, `describes`, `cost`, `image`) VALUES
(6, 2, 'KẺ ĂN HỒN', 'Trần Hữu Tấn', 'Hoàng Hà, Võ Điền Gia Huy, Huỳnh Thanh Trực, NSƯT Chiều Xuân, Nghệ sĩ Viết Liên, NSND Ngọc Thư, Nguyễn Hữu Tiến, Nguyễn Phước Lộc, Nghinh Lộc, Lý Hồng Ân, Vũ Đức Ngọc…', '109 phút', 'Tiếng Việt - Phụ đề Tiếng Anh', '2023-12-15', 'Phim về hàng loạt cái chết bí ẩn ở Làng Địa Ngục, nơi có ma thuật cổ xưa: 5 mạng đổi bình Rượu Sọ Người. Thập Nương - cô gái áo đỏ là kẻ nắm giữ bí thuật luyện nên loại rượu mạnh nhất!\r\n', 50000, 'images/70x100-teaser_kah_poster.jpg'),
(7, 6, 'THIẾU NIÊN VÀ CHIM DIỆC', 'Miyazaki Hayao', 'Santoki Soma, Suda Masaki, Shibasaki Ko, Aimyon, Kimura Yoshino, Kimura Takuya, Kobayashi Karou', '124 phút', 'Tiếng Nhật - Phụ đề Tiếng Việt', '2023-12-16', 'Đến từ Studio Ghibli và đạo diễn Miyazaki Hayao, bộ phim là câu chuyện về hành trình kỳ diệu của cậu thiếu niên Mahito trong một thế giới hoàn toàn mới lạ. Trải qua nỗi đau mất mẹ cùng mối quan hệ chẳng mấy vui vẻ với gia đình cũng như bạn học, Mahito dần cô lập bản thân... cho đến khi cậu gặp một chú chim diệc biết nói kỳ lạ. Mahito cùng chim diệc bước vào một tòa tháp bí ẩn, nơi một thế giới thần kỳ mở ra, đưa cậu gặp gỡ những người mình yêu thương... trong một nhân dạng hoàn toàn khác.', 75000, 'images/vietnam_-_poster_-_15.12.2023_1_.jpg'),
(8, 6, 'XIN CHÀO JADOO', 'Son Seok Woo', '', '76 phút', 'Tiếng Hàn - Lồng tiếng Việt', '2023-12-17', 'Bộ phim Hello Jadoo nổi bật với cốt truyện vô cùng khác biệt, đưa nhân vật Jadoo bước đến cuộc hành trình phiêu lưu vào một thế giới cổ tích tuyệt vời thông qua cuốn sách ma thuật mà Jadoo phát hiện ra trong chuyến thăm công viên giải trí.', 50000, 'images/470wx700h_2_.jpg'),
(10, 7, 'WONKA', 'Paul King', 'Timothée Chalamet, Hugh Grant, Rowan Atkinson, Matt Lucas, Mathew Baynton.', '116 phút', 'Tiếng Anh - Phụ đề Tiếng Việt; Lồng tiếng Việt', '2023-12-16', 'Dựa trên nhân vật từ quyến sách gối đầu giường của các em nhỏ trên toàn thế giới \"Charlie và Nhà Máy Sôcôla\" và phiên bản phim điện ảnh cùng tên vào năm 2005, WONKA kể câu chuyện kỳ diệu về hành trình của nhà phát minh, ảo thuật gia và nhà sản xuất sôcôla vĩ đại nhất thế giới trở thành WILLY WONKA đáng yêu mà chúng ta biết ngày nay. Từ đạo diễn loạt phim Paddington và nhà sản xuất loạt phim chuyển thể đình đám Harry Potter, WONKA hứa hẹn sẽ là một bộ phim đầy vui nhộn và màu sắc cho khán giả dịp Lễ Giáng Sinh năm nay.', 75000, 'images/700x1000_22_.jpg'),
(11, 8, 'MỘT MÌNH VẪN ỔN', 'PARK Beom-su', 'LEE Dong-wook, LIM Soo-jung, E Som', '103 phút', 'Tiếng Hàn - Phụ đề tiếng Việt', '2023-12-18', 'Vì công việc, một nữ biên tập sợ hãi cuộc sống độc thân đã được hợp tác với anh nhà văn đẹp trai, nổi tiếng nhưng mất niềm tin vào tình yêu đích thực. Cả hai sẽ kết hợp ra sao để tạo nên “bí kíp sinh tồn” qua mùa Noel cho hội ế lâu năm?', 50000, 'images/single_in_seoul_teaser_poster_vn.jpg'),
(12, 8, 'YÊU LẠI VỢ NGẦU', 'Nam Dae-jung', 'Kang Ha-neul, Jung So-min, Kim Sun-young, Lim Chul-hyung, Yoon Kyung-ho, Jo Min-soo,....', '119 phút', 'Tiếng Hàn - Phụ đề tiếng Việt, tiếng Anh', '2023-12-19', 'Cặp vợ chồng trẻ No Jung Yeol (Kang Ha-neul) và Hong Na Ra (Jung So-min) từ cuộc sống hôn nhân màu hồng dần “hiện nguyên hình” trở thành cái gai trong mắt đối phương với vô vàn thói hư, tật xấu. Không thể đi đến tiếng nói chung, Jung Yeol và Na Ra quyết định ra toà ly dị. Tuy nhiên, họ phải chờ 30 ngày cho đến khi mọi thủ tục chính thức được hoàn tất. Trong khoảng thời gian này, một vụ tai nạn xảy ra khiến cả hai mất đi ký ức và không nhớ người kia là ai. 30 ngày chờ đợi để được “đường ai nấy đi” nhưng nhiều tình huống trớ trêu khiến cả hai bắt đầu nảy sinh tình cảm trở lại. Liệu khi nhớ ra mọi thứ, họ vẫn sẽ ký tên vào tờ giấy ly hôn?', 65000, 'images/lr-main-poster-printing.jpg'),
(13, 2, 'VÒNG LẶP QUỶ DỮ', 'Awi Suryadi', 'Deva Mahenra, Della Dartyan, Nayla D. Purnama, Iwa K.', '107 phút', 'Tiếng Indonesia với phụ đề tiếng Việt', '2023-12-20', 'Hao, với khả năng nhìn thấy những sự kiện quá khứ, đã cứu Sari khỏi cơn thịnh nộ của Pocong Gundul, một phù thủy độc ác. Trong lúc trốn khỏi sự tấn công của Pocong Gundul, Hao đã sử dụng sức mạnh của mình đào sâu quá khứ và phát hiện bí mật của hắn.\r\n', 50000, 'images/v_ng_l_p_qu_d_-_payoff_poster_-_kh_i_chi_u_t_i_r_p__15.12.2023_1_.jpg'),
(14, 1, 'AQUAMAN VÀ VƯƠNG QUỐC THẤT LẠC', 'James Wan', 'Jason Momoa, Ben Affleck, Patrick Wilson...', '124 phút', 'Tiếng Anh với phụ đề tiếng Việt', '2023-12-21', 'Đạo diễn James Wan và Jason Momoa trong vai Aquaman—cùng với Patrick Wilson, Amber Heard, Yahya Abdul-Mateen II và Nicole Kidman sẽ trở lại trong phần tiếp theo của bộ phim DC có doanh thu cao nhất mọi thời đại “Aquaman Và Vương Quốc Thất Lạc (tựa gốc: Aquaman and the Lost Kingdom)”.', 75000, 'images/poster_payoff_aquaman_6_1_.jpg'),
(15, 6, 'NHÀ VỊT DI CƯ', 'Benjamin Renner', 'Kumail Nanjiani, Elizabeth Banks, Caspar Jennings, Tresi Gazal, Awkwafina,…', '76 phút', 'Tiếng Anh - Phụ đề Tiếng Việt; Lồng tiếng', '2023-12-16', 'Nhà Vịt Di Cư theo chân một gia đình vịt trời gồm vịt bố, vịt mẹ, cậu con trai tuổi teen Dax và vịt út Gwen, trong lần đầu tiên trải nghiệm chuyến di cư tiến về phía nam để trú đông. Thế nhưng, niềm vui vẻ sự háo hức kéo dài không bao lâu, gia đình vịt nhận ra, họ đang bay ngược chiều với tất cả các đàn vịt khác. Không kịp quay đầu, họ bất ngờ gặp phải loạt “chướng ngại vật” là những tòa nhà cao tầng của thành phố hiện đại. Liên tiếp sau đó là những thước phim đầy kịch tính nhưng vô cùng hài hước của nhà vịt trong quá trình khám phá đô thị mới.', 50000, 'images/470x700_6.jpg'),
(16, 7, 'TRÊN BÀN NHẬU, DƯỚI BÀN MƯU', 'TIEN M.NGUYEN', 'Kiều Minh Tuấn, Diệu Nhi, Khả Như, Thúy Ngân, Trần Ngọc Vàng, Xuân Nghị', '116 phút', 'Tiếng Việt - Phụ đề Tiếng Anh', '2023-12-20', 'Trên Bàn Nhậu Dưới Bàn Mưu là câu chuyện về tình bạn đầy thú vị của một hội bạn thân. Trong hành trình tìm kiếm những ước mơ và kế hoạch cuộc sống, họ đã vô tình bị kéo vào một âm mưu đen tối ngoài ý muốn. Sự vô tri của Gạo (Diệu Nhi), sự hậu đậu của Du Lai (Khả Như) và sự nóng nảy của Triệu (Thúy Ngân), kết hợp cùng những sáng kiến bá đạo của Trí (Kiều Minh Tuấn), đã mang đến một màn \"trả thù\" có một không hai dành cho Trực (Trần Ngọc Vàng) - một tên siêu lừa đội lốt doanh nhân và cũng là kẻ khiến cho Gạo gặp nhiều khốn đốn...', 75000, 'images/teaser_poster_-_social_1_.jpg'),
(17, 1, 'PHI CÔNG SIÊU ĐẲNG MAVERICK', 'Joseph Kosinski', 'Tom Cruise, Justin Marks, Peter Craig, Eric Warren Singer', '130 phút', 'Tiếng Anh với phụ đề tiếng Việt', '2023-12-16', 'Sau hơn ba mươi năm phục vụ, Pete “Maverick” Mitchell từng nổi danh là một phi công thử nghiệm quả cảm hàng đầu của Hải quân, né tránh cơ hội thăng chức, điều khiến anh cảm thấy bị bó buộc, để trở về làm chính mình.', 50000, 'images/top_gun_maverick_-_poster_28.03_1_.jpg'),
(18, 1, 'CHÚA TỂ CỦA NHỮNG CHIẾC NHẪN - SỰ TRỞ VỀ CỦA NHÀ VUA', 'Peter Jackson', 'Elijah Wood, Viggo Mortensen, Ian McKellen,...', '200 phút', 'Tiếng Anh - Phụ đề Tiếng Việt', '2023-12-17', 'Chương cuối cùng của loạt phim Chúa Tể Của Những Chiếc Nhẫn mang tới trận chiến cuối cùng giữa thiện và ác cùng tương lai của Trung Địa. Frodo và Sam đến với Mordor trên hành trình phá hủy chiếc nhẫn, trong khi Aragon tiếp tục lãnh đạo nhóm của mình chống lại đoàn quân của Sauron. Phần phim thứ ba này được coi là thành công nhất cả loạt phim trên khía cạnh thương mại và phê bình, với doanh thu toàn cầu vượt mốc 1 tỷ đô la cùng 11 giải Oscar danh giá.', 75000, 'images/lotr3_poster_9x16_1_.jpg'),
(19, 7, 'BẠN KHÔNG THÂN', 'Atta Hemwadee', 'Anthony Buisseret, Pisitpol Ekaphongpisit, Thitiya Jirapornsilp', '129 phút', 'Tiếng Thái - Phụ đề tiếng Việt', '2023-12-21', 'Bắt đầu với niềm đam mê làm phim bất diệt cùng những ý tưởng lớn, nhóm học sinh trung học của “Bạn Không Thân” chính là hội bạn trong “hoạn nạn” lại cần tới nhau tại một cuộc thi làm phim ngắn dựa trên câu chuyện về cuộc đời của người bạn cùng lớp mà họ yêu quý. Bằng vốn hiểu biết có giới hạn về người bạn quá cố, cả nhóm với sự nỗ lực 200% đã dần khám phá ra những bí mật ẩn giấu gây bất ngờ tới mức có thể thay đổi quan điểm về niềm đam mê của hội thanh thiếu niên này mãi mãi.', 65000, 'images/crew_1080x1350_1_.jpg'),
(20, 1, 'BỖNG DƯNG TRÚNG MÁNH', 'Hwang Dong-seok', 'Yoo Seon-ho, Kang Mi-na, Yoo In-soo, Shin Soo-hyun, Lee Chan-hyeong, Seo Hye-won', '95 phút', 'Tiếng Hàn - Phụ đề tiếng Việt, tiếng Anh', '2023-12-19', 'Bỗng Dưng Trúng Mánh là câu chuyện từ cá biệt toàn trường hoá tài phiệt học đường của Lee Kang-jin - một học sinh vốn thường xuyên bị bắt nạt. Tình cờ nhặt được chiếc phong bì chứa đầy tiền mặt của ông trùm cho vay nặng lãi Rang, cuộc đời Kang-jin đã hoàn toàn thay đổi. Rang dạy Kang-jin những bài học đầu tiên về nghề cho vay siêu lợi nhuận, từ đó biến cậu học trò lầm lì trở thành chiến thần tài chính, đại gia mới nổi, ông hoàng cho vay nặng lãi của trường trung học Geumhwa.', 75000, 'images/_web_size_gj_main-poster_1_.jpg'),
(21, 2, 'ÂM HỒN SIAM', 'Jetniphut Sa-Shing', 'Ying Ariya Buakong, Lura Chansri, Chutiya Jiarakul', '90 phút', 'Tiếng Thái - Phụ đề Tiếng Việt và Tiếng Anh', '2023-12-22', 'Bộ phim kể về mối tình tay ba của hai người bạn thân cùng phải lòng một chàng trai, nhưng cuối cùng chuyện tình này lại động chạm đến ma thuật hắc ám. Điều này đã dẫn đến một thảm kịch khi cuộc trả thù kinh hoàng kéo dài và liên lụy đến đời sau.', 65000, 'images/_m_h_n_siam_-_payoff_poster_-_d_ki_n_kh_i_chi_u_01.12.2023.jpg'),
(22, 8, 'NGƯỜI VỢ CUỐI CÙNG', 'Victor Vũ', 'Kaity Nguyễn - Thuận Nguyễn - NSƯT Quang Thắng - NSƯT Kim Oanh - Đinh Ngọc Diệp - Anh Dũng - Quốc Huy - Bé Lưu Ly', '132 phút', 'Tiếng Việt - Phụ đề Tiếng Anh', '2023-12-23', 'Lấy cảm hứng từ tiểu thuyết Hồ Oán Hận, của nhà văn Hồng Thái, Người Vợ Cuối Cùng là một bộ phim tâm lý cổ trang, lấy bối cảnh Việt Nam vào triều Nguyễn. LINH - Người vợ bất đắc dĩ của một viên quan tri huyện, xuất thân là con của một gia đình nông dân nghèo khó, vì không thể hoàn thành nghĩa vụ sinh con nối dõi nên đã chịu sự chèn ép của những người vợ lớn trong gia đình. Sự gặp gỡ tình cờ của cô và người yêu thời thanh mai trúc mã của mình - NH N đã dẫn đến nhiều câu chuyện bất ngờ xảy ra khiến cuộc sống cô hoàn toàn thay đổi.', 65000, 'images/700x1000_13_1_.jpg'),
(24, 1, 'ĐẤU TRƯỜNG SINH TỬ: KHÚC HÁT CỦA CHIM CA VÀ RẮN ĐỘC', 'Francis Lawrence', 'Rachel Zegler, Hunter Schafer, Tom Blyth, Jason Schwartzman…', '157 phút', 'Tiếng Anh - Phụ đề Tiếng Việt', '2023-12-15', 'Đấu Trường Sinh Tử: Khúc Hát Của Chim Ca Và Rắn Độc là phần tiền truyện của mạch truyện chính, lấy bối cảnh 64 năm trước phần phim đầu tiên. Mạch phim theo chân Coriolanus Snow trẻ tuổi, chính là vị Tổng thống Snow trong loạt phim sau này. Lúc này Coriolanus là niềm hy vọng cuối cùng cho dòng dõi Snow đang dần lụi tàn. Được chỉ định trở thành cố vấn cho trò chơi, vai trò của anh là trợ giúp vật tế trong đấu trường và anh sẽ là cố vấn của Lucy Gray Baird - một cô gái đặc biệt đến từ Quận 12.', 20000, 'images/poster_payoff_1_.jpg'),
(25, 1, 'ĐẤU TRƯỜNG SINH TỬ: KHÚC HÁT CỦA CHIM CA VÀ RẮN ĐỘC', 'Francis Lawrence', 'Rachel Zegler, Hunter Schafer, Tom Blyth, Jason Schwartzman…', '157 phút', 'Tiếng Anh - Phụ đề Tiếng Việt', '2023-12-22', 'Đấu Trường Sinh Tử: Khúc Hát Của Chim Ca Và Rắn Độc là phần tiền truyện của mạch truyện chính, lấy bối cảnh 64 năm trước phần phim đầu tiên. Mạch phim theo chân Coriolanus Snow trẻ tuổi, chính là vị Tổng thống Snow trong loạt phim sau này. Lúc này Coriolanus là niềm hy vọng cuối cùng cho dòng dõi Snow đang dần lụi tàn. Được chỉ định trở thành cố vấn cho trò chơi, vai trò của anh là trợ giúp vật tế trong đấu trường và anh sẽ là cố vấn của Lucy Gray Baird - một cô gái đặc biệt đến từ Quận 12.', 20000, 'images/poster_payoff_1_.jpg'),
(26, 1, 'ĐẤU TRƯỜNG SINH TỬ: KHÚC HÁT CỦA CHIM CA VÀ RẮN ĐỘC', 'Francis Lawrence', 'Rachel Zegler, Hunter Schafer, Tom Blyth, Jason Schwartzman…', '157 phút', 'Tiếng Anh - Phụ đề Tiếng Việt', '2023-12-21', 'Đấu Trường Sinh Tử: Khúc Hát Của Chim Ca Và Rắn Độc là phần tiền truyện của mạch truyện chính, lấy bối cảnh 64 năm trước phần phim đầu tiên. Mạch phim theo chân Coriolanus Snow trẻ tuổi, chính là vị Tổng thống Snow trong loạt phim sau này. Lúc này Coriolanus là niềm hy vọng cuối cùng cho dòng dõi Snow đang dần lụi tàn. Được chỉ định trở thành cố vấn cho trò chơi, vai trò của anh là trợ giúp vật tế trong đấu trường và anh sẽ là cố vấn của Lucy Gray Baird - một cô gái đặc biệt đến từ Quận 12.', 20000, 'images/rsz_dune-2.jpg'),
